import { Component } from '@angular/core';
@Component({
  selector: 'app-navbar-vertical-content',
  templateUrl: './navbar-vertical-content.component.html',
  styleUrls: ['./navbar-vertical-content.component.scss'],
})
export class NavbarVerticalContentComponent {}
<div class="navbar-vertical-content">
  <div id="navbarVerticalMenu" class="nav nav-pills nav-vertical card-navbar-nav">
    <!-- Collapse -->
    <app-teams></app-teams>
    <app-nav-item></app-nav-item>
    <span class="w-100 border"></span>
</div>
